scopecontent.p:
This series includes materials related to the Baldwin Scholars Program, especially its
            early development. Included are materials related to program parameters and structure;
            courses and curriculum; budget and funding, including fundraising; student scholars;
            planning; staff; and many other topics. Files include correspondence, reports, budgets,
            and other materials. Jean Fox O'Barr, co-director of the Program, is a frequent
            correspondent.
